int32_t sum_positive(const int32_t *vec, size_t len) {
    int32_t *positive = NULL;
    size_t pos_len = 0;
    size_t pos_cap = 0;

    for (size_t i = 0; i < len; ++i) {
        if (vec[i] > 0) {
            if (pos_len == pos_cap) {
                pos_cap = pos_cap ? pos_cap * 2 : 4;
                int32_t *tmp = (int32_t *)realloc(positive, pos_cap * sizeof(int32_t));
                if (!tmp) {
                    free(positive);
                    return 0;
                }
                positive = tmp;
            }
            positive[pos_len++] = vec[i];
        }
    }

    int32_t sum = 0;
    for (size_t i = 0; i < pos_len; ++i) {
        sum += positive[i];
    }

    free(positive);
    return sum;
}

