    for (int i = 0; i < size; i++) {
        if (vec[i] > 0) {
            new_vec[new_size] = vec[i]; // Add positive number to new vector
            new_size++;
        }
    }

    // Calculate the sum of the new vector
    for (int i = 0; i < new_size; i++) {
        sum += new_vec[i];
    }

    return sum;
